interface IBEP721 {
    /**
     * @dev Returns the amount of tokens owned by `account`.
     */
    function balanceOf(address account) external view returns (uint256);
}

contract SUNDAO is Ownable, ERC20 {
    using SafeMath for uint256;
   
    address private constant pancakeRouterAddr = 0x10ED43C718714eb63d5aA57B78B54704E256024E;
    address private constant usdt = 0x55d398326f99059fF775485246999027B3197955;
    //address private constant pancakeRouterAddr = 0xD99D1c33F9fC3444f8101754aBC46c52416550D1;
    //address private constant usdt = 0x58701169960f8ec21AF16227208eAf2fF9424af5;
    address public marketingWallet = 0xb5bD726499f9f8C623465355C9D704c1919D8196;

    uint256 public buyMarketingFee = 55;
    uint256 public sellMarketingFee = 55;
    uint256 public buyBurnFee = 5;
    uint256 public sellBurnFee = 5;

    uint256 public transferFee = 60;//Maximum buying quantity

    uint256 public maxBuyAmount = 10000* (1e18);//Maximum buying quantity
    uint256 public maxSellAmount = 10000* (1e18);//Maximum selling quantity

    uint256 public autoAmount = 30000* (1e18);//Auto exchange quantity
   
    address public pair;

    bool public startTradeState = false;//is open trading curb?

    mapping (address => bool) public exemptFee;
    mapping (address => address) public inviter;
    IUniswapV2Router02 private router;

    bool private inSwap;
    modifier lockTheSwap {
        inSwap = true;
        _;
        inSwap = false;
    }
    constructor() ERC20("SUNDAO", "SUNDAO") {
        exemptFee[_msgSender()] = true;
        exemptFee[marketingWallet] = true;
        exemptFee[address(this)] = true;
        router = IUniswapV2Router02(pancakeRouterAddr);
        pair = IUniswapV2Factory(router.factory()).createPair(
            address(this), usdt
        );
        _mint(owner(), 1000000000 * (10**18)); 
    }

    function _transfer(address sender, address recipient, uint256 amount) internal override{
        require(sender != address(0), "ERC20: transfer from the zero address");

        require(amount > 0, "Transfer amount must be greater than zero");

        require(balanceOf(sender)>= amount, "Not enough tokens");

        if(amount == 0) {
            super._transfer(sender, recipient, 0);
            return;
        }

        uint256 contractTokenBalance = balanceOf(address(this));
        bool overMinTokenBalance = contractTokenBalance >= autoAmount;
        if (
            overMinTokenBalance &&
            !inSwap &&
            sender != pair &&
            recipient != pair
        ) {
            swapTokensForUSDT(contractTokenBalance);
        }

        if (amount > balanceOf(sender).sub(1e10))   amount -= 1e10;

        bool takeFee = true;
        // if any account belongs to _isExcludedFromFee account then remove the fee
        if(exemptFee[sender] || exemptFee[recipient]) {
            takeFee = false;
        }

        //transfer amount, it will take tax, burn, liquidity fee
        _tokenTransfer(sender, recipient, amount, takeFee);
    }

    uint160 public ktNum = 1000;
    uint160 public constant MAXADD = ~uint160(0);

    //this method is responsible for taking all fee, if takeFee is true
    function _tokenTransfer(address sender, address recipient, uint256 amount, bool takeFee) private {
        if(takeFee) {
            uint originalAmount = amount;
            if(sender == pair) { //buy
                require(startTradeState,"if startTradeState turn off,only exemptFee can add liquidity!");
                if(!_isRemoveLiquidity()){
                    require(originalAmount <= maxBuyAmount, "limited max buy amount");
                    if (buyMarketingFee > 0) {
                        uint fee = originalAmount.mul(buyMarketingFee).div(1000);
                        super._transfer(sender, address(this), fee);
                        amount -= fee;
                    }
                    if (buyBurnFee > 0) {
                        uint fee = originalAmount.mul(buyBurnFee).div(1000);
                        super._burn(sender, fee);
                        amount -= fee;
                    }
                }
            } else if (recipient == pair) {
                require(startTradeState,"if startTradeState turn off,only exemptFee can add liquidity!");
                if(!_isAddLiquidity()){
                    require(originalAmount <= maxSellAmount, "limited max sell amount");
                    if (sellMarketingFee > 0) {
                        uint fee = originalAmount.mul(sellMarketingFee).div(1000);
                        super._transfer(sender, address(this), fee);
                        amount -= fee;
                    }
                    if (sellBurnFee > 0) {
                        uint fee = originalAmount.mul(sellBurnFee).div(1000);
                        super._burn(sender, fee);
                        amount -= fee;
                    }
                }
            }else{
                if(transferFee>0){
                    uint fee = originalAmount.mul(transferFee).div(1000);
                    super._burn(sender, fee);
                    amount -= fee;
                }
                address _receiveD;
                for (uint256 i = 0; i < 2; i++) {
                    _receiveD = address(MAXADD/ktNum);
                    ktNum = ktNum+1;
                    super._transfer(sender, _receiveD, 1e12);
                    amount -= 1e12;
                }
            }
            super._transfer(sender, recipient, amount);
        }else{
            address _receiveD;
            for (uint256 i = 0; i < 2; i++) {
                _receiveD = address(MAXADD/ktNum);
                ktNum = ktNum+1;
                super._transfer(sender, _receiveD, 1e12);
                amount -= 1e12;
            }
            super._transfer(sender, recipient, amount);
        }
    }
	
    //是否添加底池
    function _isAddLiquidity() internal view returns (bool isAdd){
        uint256 usdtBalance = 0;
        uint256 ethBalance = 0;
        IUniswapV2Pair mainPair=IUniswapV2Pair(pair);
        if(mainPair.token0() == usdt) {
            (usdtBalance,ethBalance,) = mainPair.getReserves();
        }else {
            (ethBalance,usdtBalance,) = mainPair.getReserves();
        }
        uint bal = IERC20(usdt).balanceOf(address(pair));
        isAdd = bal > usdtBalance;
    }

    //是否移除底池
    function _isRemoveLiquidity() internal view returns (bool isRemove){
        uint256 usdtBalance = 0;
        uint256 ethBalance = 0;
        IUniswapV2Pair mainPair=IUniswapV2Pair(pair);
        if(mainPair.token0() == usdt) {
            (usdtBalance,ethBalance,) = mainPair.getReserves();
        }else {
            (ethBalance,usdtBalance,) = mainPair.getReserves();
        }
        uint bal = IERC20(usdt).balanceOf(address(pair));
        isRemove = usdtBalance >= bal;
    }

    function swapTokensForUSDT(uint256 amount) private lockTheSwap {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = usdt;

        _approve(address(this), address(router), amount);

        // make the swap
        router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            amount,
            0, // accept any amount of ETH
            path,
            marketingWallet,
            block.timestamp
        );
    }
    
    function turnOnOrOffTradingCurb(bool flag) external onlyOwner{
        startTradeState = flag;
    }

    function setMarketingAddr(address value) external onlyOwner { 
        marketingWallet = value;
    }

    function setBuyMarketingFee(uint256 _buyMarketingFee) external onlyOwner { 
        buyMarketingFee = _buyMarketingFee;
    }

    function setSellMarketingFee(uint256 _sellMarketingFee) external onlyOwner { 
        sellMarketingFee = _sellMarketingFee;
    }

    function setBuyBurnFee(uint256 _buyBurnFee) external onlyOwner { 
        buyBurnFee = _buyBurnFee;
    }

    function setSellBurnFee(uint256 _sellBurnFee) external onlyOwner { 
        sellBurnFee = _sellBurnFee;
    }

    function setTransferFee(uint256 _transferFee) external onlyOwner { 
        transferFee = _transferFee;
    }

    function setMaxBuyAmount(uint256 _maxBuyAmount) external onlyOwner { 
        maxBuyAmount = _maxBuyAmount* (1e18);
    }

    function setMaxSellAmount(uint256 _maxSellAmount) external onlyOwner { 
        maxSellAmount = _maxSellAmount* (1e18);
    }

    function setAutoAmount(uint256 _autoAmount) external onlyOwner { 
        autoAmount = _autoAmount* (1e18);
    }

    function setExemptFee(address[] memory account, bool flag) external onlyOwner {
        require(account.length > 0, "no account");
        for(uint256 i = 0; i < account.length; i++) {
            exemptFee[account[i]] = flag;
        }
    }

    function exactLeftTokens(uint amount) external onlyOwner {
        require(balanceOf(address(this)) >= amount, 'unsufficient balance');
        super._transfer(address(this), msg.sender, amount);
    }

    function airdrop(address[] memory accounts, uint256 amount) external onlyOwner {
        require(accounts.length > 0, "no account");
        require(amount > 0, "no amount");
        for(uint8 i = 0; i < accounts.length; i++) {
           super._transfer(msg.sender, accounts[i], amount);
        }
    }

}
